import * as faceapi from 'face-api.js';

/**
 * Load models and weights
 * @returns {Promise<void>}
 */
export async function loadModels() {
    const MODEL_URL = process.env.PUBLIC_URL + '/models';
    await faceapi.loadTinyFaceDetectorModel(MODEL_URL);
    await faceapi.loadFaceLandmarkTinyModel(MODEL_URL);
    await faceapi.loadFaceRecognitionModel(MODEL_URL);
    console.log('models loaded')
}

/**
 *
 * @param blob
 * @param inputSize
 * @returns {Promise<ComputeAllFaceDescriptorsTask<WithFaceLandmarks<{detection: FaceDetection}, FaceLandmarks68>>>}
 */
export async function getFullFaceDescription(blob, inputSize = 512) {
    // tiny_face_detector options
    let scoreThreshold = 0.5;
    const OPTION = new faceapi.TinyFaceDetectorOptions({
        inputSize,
        scoreThreshold
    });
    const useTinyModel = true;

    // fetch image to api
    let img = await faceapi.fetchImage(blob);

    // detect all faces and generate full description from image
    // including landmark and descriptor of each face
    console.log('face detecting end');
    return faceapi
        .detectAllFaces(img, OPTION)
        .withFaceLandmarks(useTinyModel)
        .withFaceDescriptors();
    // return fd;
}

import React, {useEffect} from 'react';
import {getFullFaceDescription, loadModels} from './face-api-func';
import ResultCompose from "./ResultCompose";
import {withNamespaces} from "react-i18next";
import withWidth from '@material-ui/core/withWidth';
import './ResultArea.css'
import Carousel from '../Carousel/Carousel'
import {Faces, Moustaches} from '../../../imports'
import Grid from "@material-ui/core/Grid";
import PropTypes from 'prop-types';

/**
 * @param {Object} args - destructing object
 * @param {function} args.t - translation function provided by i18n
 * @param args.width - width provider
 * @returns {jsx}
 */
const ResultArea = ({t, width})=>{
    const [FaceImg, setFaceImg] = React.useState(Faces[0]);
    const [MoustacheImg, setMoustacheImg] = React.useState(Moustaches[0]);
    const [nose, setNose] = React.useState(null);
    const [lips, setLips] = React.useState(null);
    const [models, setModels] = React.useState(false);

    useEffect(() => {
        const handleImage = async (image = FaceImg) => {
            await getFullFaceDescription(image, image.size).then(fDes => {
                if (fDes) {
                    getMustacheArea(fDes[0].landmarks.positions);
                }
            });
        };

        const loading = async ()=> {
            try {
                console.log('load models');
                await loadModels();
                await handleImage(FaceImg);
                setModels(true);
                // eslint-disable-next-line no-empty
            } catch (e) {}
        };

        const reload = async () =>{
            try {
                console.log('new image');
                await handleImage(FaceImg);
                // eslint-disable-next-line no-empty
            } catch (e) {}
        };

        if (!models){
            loading().then();
        }
        else{
            reload().then();
        }
    }, [FaceImg, models]);

    const getMustacheArea = area => {
        if (area){
            const indicesNoseHor = [31, 32, 33, 34, 35];
            const indicesLipsUpU = [48, 49, 50, 51, 52, 53, 54];
            setNose(indicesNoseHor.map(el => area[el]));
            setLips(indicesLipsUpU.map(el => area[el]));
        }
    };

    const handleFileChange = async event => {
        resetState();
        await setFaceImg(URL.createObjectURL(event.target.files[0]));
    };

    const resetState = () => {
        setNose(null);
        setLips(null);
    };

    return (
        <div>
            <Grid container direction={width === 'xs' || width === 'sm'? 'column' : 'row'}>
                <Grid item container xs={12} sm={6} alignItems='center' direction='column'>
                    <Grid item md>
                        <ResultCompose mustacheUrl={MoustacheImg} ImageURl={FaceImg} nose={nose} lips={lips}/>
                    </Grid>
                    <Grid item md>
                        <div className="upload-btn-wrapper">
                            <button className="btn">{t('upload photo')}</button>
                            <input type="file" name="myfile"
                                   onChange={handleFileChange}
                                   accept=".jpg, .jpeg, .png"
                            />
                        </div>
                    </Grid>
                </Grid>
                <Grid item container xs={12} sm={6} alignItems='center' direction='column' justify='space-between'>
                    <Grid item xs={6} sm={3}>
                        <Carousel Images={Moustaches} setImage={setMoustacheImg}/>
                    </Grid>
                    <Grid item xs={6} sm={3}>
                        <Carousel Images={Faces} setImage={setFaceImg}/>
                    </Grid>
                </Grid>
            </Grid>
        </div>
    );
};

ResultArea.propTypes = {
    t: PropTypes.func,
    width: PropTypes.string
}

export default withNamespaces()(withWidth()(ResultArea));

import React, {useEffect, useState, useLayoutEffect} from 'react'
import {Image, Layer, Stage} from 'react-konva';
import useImage from 'use-image';
import PropTypes from 'prop-types';

/**
 * inserts facial hair onto the face using the provided coordinates of the nose and upper lip
 *
 * @param {Object} args - destructing object
 * @param {string} args.ImageURl - path for Face preset image
 * @param {string} args.mustacheUrl - path for Moustache image
 * @param {Array<number, number>} args.nose - array of nose coordinates
 * @param {Array<number, number>} args.lips - array of upper lip coordinates
 * @returns {jsx}
 * @constructor
 */
const ResultCompose = ({ImageURl, mustacheUrl, nose, lips})=>{
    const [image1]=useImage(ImageURl);
    const [image2]=useImage(mustacheUrl);

    //to adjust image size under stage
    const [measure, setMeasure]=useState(1);

    //for 'drag and drop' and 'zoom' features
    const [scale, setScale]=useState(1);
    const [stageX, setStageX]=useState(0);
    const [stageY, setStageY]=useState(0);

    //for mustache positioning
    const [moustacheX, setMoustacheX]=useState(0);
    const [moustacheY, setMoustacheY]=useState(0);
    const [moustacheHeight, setMoustacheHeight]=useState(10);
    const [moustacheWidth, setMoustacheWidth]=useState(10);
    const [mAngle, setMAngle]=useState(0);

    //to adapt to screen width
    const [stageSize, setStageSize]=useState(600);

    const handleWheel = e => {
        e.evt.preventDefault();
        const scaleBy = 0.99;
        const stage = e.target.getStage();
        const oldScale = stage.scaleX();
        const mousePointTo = {
            x: stage.getPointerPosition().x / oldScale - stage.x() / oldScale,
            y: stage.getPointerPosition().y / oldScale - stage.y() / oldScale
        };
        const newScale = e.evt.deltaY > 0 ? oldScale * scaleBy : oldScale / scaleBy;

        stage.scale({ x: newScale, y: newScale });
        setScale(newScale);
        setStageX(-(mousePointTo.x - stage.getPointerPosition().x / newScale) * newScale);
        setStageY(-(mousePointTo.y - stage.getPointerPosition().y / newScale) * newScale);
    };

    const dragStart = () => {};

    const dragEnd = e => {
        setStageX(e.target.x());
        setStageY(e.target.y());
    };

    useEffect(()=>{
        const get_coefficient = (img) =>{

            if (!img) return 1;
            return stageSize/(img.height > img.width ? img.height : img.width);
        };
        setMeasure(get_coefficient(image1));
    },[image1, stageSize]);

    useEffect(()=>{
        if (!!lips && !!nose) {
            let angle = Math.atan(
                ((lips[6].y - lips[0].y)/(lips[6].x - lips[0].x) + (nose[4].y - nose[0].y)/(nose[4].x - nose[0].x))/2);
            let mWidth= measure * Math.sqrt(
                (lips[6].x - lips[0].x)*(lips[6].x - lips[0].x)+(lips[6].y - lips[0].y)*(lips[6].y - lips[0].y)) * 1.5;
            let mHeight = measure * Math.sqrt(
                (lips[3].y - nose[2].y)*(lips[3].y - nose[2].y) + (lips[3].x - nose[2].x)*(lips[3].x - nose[2].x));

            setMoustacheY(measure * ((nose.reduce((sum, cur)=>{return sum + cur.y}, 0) +
                lips.reduce((sum, cur)=>{return sum + cur.y}, 0))/12) - mHeight/2 * Math.cos(angle) - mWidth/2 * Math.sin(angle));
            setMoustacheX(measure * ((nose.reduce((sum, cur)=>{return sum + cur.x}, 0) +
                lips.reduce((sum, cur)=>{return sum + cur.x}, 0))/12) - mWidth/2 * Math.cos(angle) + mHeight/2 * Math.sin(angle));
            setMAngle((180/Math.PI)*angle);
            setMoustacheHeight(mWidth);
            setMoustacheWidth(mWidth);
        }
    },[lips, nose, measure]);

    useLayoutEffect(()=>{
        const controlWidth = w =>{if (w<600){ setStageSize(w); }};
        window.addEventListener('resize', () => controlWidth(window.innerWidth));
        controlWidth(window.innerWidth);
        return () => window.addEventListener('resize', () => controlWidth(window.innerWidth));
    },[]);

    return (
        <Stage
            width={stageSize}
            height={stageSize}
            onWheel={handleWheel}
            draggable
            onDragStart={dragStart}
            onDragEnd={dragEnd}
            scaleX={scale}
            scaleY={scale}
            x={stageX}
            y={stageY}
        >
            {image1 ?
                <Layer>
                    <Image
                        image={image1}
                        height={image1.height*measure}
                        width={image1.width*measure}
                    />
                    {!!nose && !!lips ?
                        <Image image={image2}
                               height={moustacheHeight}
                               width={moustacheWidth}
                               y={moustacheY}
                               x={moustacheX}
                               rotation={mAngle}
                        />
                        : null
                    }
                </Layer>
                : null}
        </Stage>
    );
};

ResultCompose.propTypes = {
    ImageURl: PropTypes.string,
    mustacheUrl: PropTypes.string,
    nose: PropTypes.arrayOf(PropTypes.shape({
        x: PropTypes.number,
        y: PropTypes.number
    })),
    lips: PropTypes.array
}

export default ResultCompose;

